import React from "react";
import { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

function Destinations(props) {
  let [places, setPlaces] = useState();

  const options = {
    method: "GET",
    url: "https://api.sygictravelapi.com/1.2/en",
    headers: {
      "x-rapidapi-key": "5ae2e3f221c38a28845f05b66029fab11ec2dd4f02e8fe73f1bd6502",
      "x-rapidapi-host": "https://api.sygictravelapi.com/1.2/en",
    },
  };

  axios
    .request(options)
    .then((res) => {
      console.log(res.data);
    })
    .catch((error) => {
      console.error(error);
    });

  return (
    <div>
      <h1>Step 1: Destinations</h1>
      <div className="buttons-row">
        <Link to="/">
          <button>Previous: Home</button>
        </Link>
        <Link to="/attractions">
          <button>Next: Attractions</button>
        </Link>
      </div>
    </div>
  );
}

export default Destinations;
